CREATE PROCEDURE [dbo].[spAds_UpdateAd]
	@Id INT,
	@Title NVARCHAR(50),	
	@Description NVARCHAR(1000),
	@Price MONEY,
	@ModelName NVARCHAR(30), 
	@Kilometers NVARCHAR(7), 
	@CubicCapacity NVARCHAR(5), 
	@HorsePower NVARCHAR(5), 
	@Kilowatts NVARCHAR(5),
	@ClientName NVARCHAR(50), 
	@Address NVARCHAR(100), 
	@City NVARCHAR(30), 
	@ZIP NVARCHAR(10), 
	@Country NVARCHAR(30), 
	@Phone NVARCHAR(20),
	@ClientId INT,
	@BrandId INT,
	@CarBodyTypeId INT,
	@CarConditionId INT,
	@ColorId INT,
	@FuelId INT,
	@ProductionYearId INT
AS

	SET NOCOUNT ON;
BEGIN TRY
	SELECT [Id], [BrandName]
	FROM [dbo].[Brands];
	RETURN 0;
END TRY
BEGIN CATCH
	RETURN ERROR_NUMBER();
END CATCH

	SET NOCOUNT ON;
BEGIN TRY
	SELECT [Id], [BodyType]
	FROM [dbo].[CarBodyTypes];
	RETURN 0;
END TRY
BEGIN CATCH
	RETURN ERROR_NUMBER();
END CATCH

	SET NOCOUNT ON;
BEGIN TRY
	SELECT [Id], [FirstOwner], [Warranty], [Garaged], [ServiceBook], [SpareKey], [Restaurated], 
		   [Oldtimer], [AdaptedForTheDisabled], [TaxiCar], [TestCar], [Tuning]
	FROM [dbo].[CarConditions];
	RETURN 0;
END TRY
BEGIN CATCH
	RETURN ERROR_NUMBER();
END CATCH

	SET NOCOUNT ON;
BEGIN TRY
	INSERT INTO [dbo].[Clients]
	([DateRegistered], [ClientName], [Address], [City], [ZIP], [Country], [Phone])
	VALUES
	(@DateRegistered, @ClientName, @Address, @City, @ZIP, @Country, @Phone);

	SET @Id = SCOPE_IDENTITY();

	RETURN 0;
END TRY
BEGIN CATCH
	RETURN ERROR_NUMBER();
END CATCH

